(lib.GameScreen = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{"open":1,"opened":19,"close":20,"closed":39});

	// timeline functions:
	this.frame_0 = function() {
		this.stop();
	}
	this.frame_19 = function() {
		this.stop();
		this.dispatchEvent('opened');
		
		var gScreen = this;
		var speed = 8;  
		var moveLeft = false;  
		var moveRight = false;  
		var moveUp = false;  
		var moveDown = false; 
		var points = 0;
		var gameOver = false; 
		
		var BULLET_SPEED = 15;  
		var bullets;  
		bullets = new Array(); 
		
		var enemies; 
		enemies = new Array();
		
		var explosions; 
		explosions = new Array();
		
		var score = this.gameScore_mc.score_txt;
		score.y=0;
		score.text = "SCORE: "+ points;
		
		var player = new lib.Player(); 
		player.x = 192;
		player.y = 557;
		this.addChild(player); 
		
		var S_WIDTH = 384;
		var S_HEIGHT = 512;
		
		var LEFT_MARGIN = 26;
		var BOUNDS_LEFT =  S_WIDTH - S_WIDTH + player.getBounds().width * 0.5 + LEFT_MARGIN;
		var BOUNDS_RIGHT = S_WIDTH - player.getBounds().width * 0.5;
		
		var BOUNDS_TOP = S_HEIGHT- S_HEIGHT + player.getBounds().height * 0.5;
		var BOUNDS_BOTTOM = S_HEIGHT -player.getBounds().height * 0.5;
		
		var ENEMY_LIMIT = 5;  
		var ENEMY_SPEED = 8; 
		
		document.onkeydown = onKeyDown;  
		document.onkeyup   = onKeyUp;  
		
		startGame();
		
		function startGame(){
		    createjs.Ticker.addEventListener("tick", gameLoop);
		}
		
		function spawnPlayer() {
		    if(player.y >= 468){
		        player.y-=10;
		    }else{
		      return;
		  }
		}
		
		function onKeyDown(e) {       
		    if(!e){ var e = window.event; }  
		    switch(e.keyCode) {  
		        // left  
		        case 37: moveLeft = true; moveRight = false;      
		        break;                    
		        // up  
		        case 38: moveUp = true; moveDown = false;  
		        break;                    
		        // right  
		        case 39: moveRight = true; moveLeft = false;  
		        break;                                        
		        // down  
		        case 40: moveDown = true; moveUp = false;  
		        break;  
		    }  
		}  
		
		function onKeyUp(e) {         
		   if(!e){ var e = window.event; }  
		   
		   switch(e.keyCode) {  
		        // left  
		        case 37: moveLeft = false;   
		        break;                    
		        // up  
		        case 38: moveUp = false;  
		        break;  
		        // right  
		        case 39: moveRight = false;  
		        break;  
		        // down  
		        case 40: moveDown = false;  
		        break;   
		        // Space bar for shooting  
		        case 32: shoot();  
		        break;
		    }  
		}  
		
		function checkPlayerBounds() {  
		    if(moveLeft) {  
		        player.x -= speed;  
		        if(player.x < BOUNDS_LEFT)  
		            player.x = BOUNDS_LEFT;  
		    }  
		    else if(moveRight) {  
		        player.x += speed;  
		        if(player.x > BOUNDS_RIGHT)  
		            player.x = BOUNDS_RIGHT;  
		    }  
		    
		    if(moveUp) {  
		        if(player.y - speed > BOUNDS_TOP)  
		            player.y -= speed;  
		        
		    }  
		    else if(moveDown) {  
		        if(player.y + speed < BOUNDS_BOTTOM)  
		            player.y += speed;  
		    }  
		} 
		
		function spawnEnemy() {  
		    if(randRange(0, 100) > 80 && enemies.length < ENEMY_LIMIT) { 
		        
		        var r = new lib.Enemy();  
		        r.regX = r.width * 0.5;  
		        r.regY = r.height * 0.5;  
		        r.x = randRange(20, 384);  
		        r.y = -randRange(50, 100);  
		        enemies.push(r);                
		        gScreen.addChildAt(r,1);  
		    }  
		} 
		
		function updateEnemies() {  
		    var loopLimit = enemies.length - 1;  
		    for(var i = loopLimit; i >= 0; --i) {  
		        enemies[i].y += ENEMY_SPEED;  
		        if(enemies[i].y > BOUNDS_BOTTOM) {                     
		            gScreen.removeChild(enemies[i]);  
		            enemies.splice(i, 1);  
		        }  
		    }  
		} 
		
		
		function shoot() {               
		    var bullet = new lib.Bullet(); 
		    createjs.Sound.play("BulletSound");
		    bullet.x = player.x -4;  
		    bullet.y = player.y -60; 
		    bullets.push(bullet);  
		    gScreen.addChild(bullet);  
		} 
		
		function updateBullets() {  
		    var bLimit = bullets.length - 1;  
		    
		    for(var i = bLimit; i >= 0; --i) {  
		        bullets[i].y -= BULLET_SPEED;  
		        if(bullets[i].y < -19) {  
		            gScreen.removeChild(bullets[i]);                    
		            bullets.splice(i, 1); 
		        }  
		    }  
		} 
		
		function collide() {  
		  var numEnemies = enemies.length - 1;  
		  var numBullets = bullets.length - 1;  
		  var currentEnemy, curBullet;  
		  
		  for(var i = numEnemies; i >= 0; --i) {  
		    currentEnemy = enemies[i];  
		    if(distance(currentEnemy, player) < 45) {   
		        endGame(); 
		    }  
		    
		    for(var j = numBullets; j >= 0; --j) {  
		      curBullet = bullets[j];  
		      
		      if( distance(currentEnemy, curBullet) < 32)  {  
		        gScreen.removeChild(currentEnemy);  
		        gScreen.removeChild(curBullet); 
		        createExplosion(currentEnemy.x, currentEnemy.y); 
		        enemies.splice(i, 1);  
		        bullets.splice(j, 1);
		        points+=5;  
		    }  
		}  
		numBullets = bullets.length - 1;  
		}  
		} 
		
		function createExplosion(xpos, ypos) {  
		    var exp = new lib.Damage();  
		    exp.regX = exp.width * 0.5;  
		    exp.regY = exp.height * 0.5;  
		    exp.x = xpos;  
		    exp.y = ypos;  
		    explosions.push(exp);  
		    createjs.Sound.play("ExplosionSound");
		    gScreen.addChild(exp);  
		}
		
		function updateExplosions() {  
		    var loopLimit = explosions.length - 1;  
		    for(var i = loopLimit; i >= 0; --i) {  
		        explosions[i].alpha -= 0.1;  
		        if(explosions[i].alpha <= 0) {  
		            gScreen.removeChild(explosions[i]);  
		            explosions.splice(i, 1);  
		        }  
		    }  
		}  
		
		function updateScore(){
		    score.text = "SCORE: "+ points;
		}
		
		
		function endGame() {  
		    createExplosion(player.x, player.y);  
		    gScreen.removeChild(player);      
		    gameOver = true;              
		    gScreen.gotoAndPlay("close");
		    document.onkeydown = null;  
		    document.onkeyup   = null;
		    root.score = points;
		    
		    var currentEnemy;
		    var numEnemies = enemies.length - 1;
		    
		    for(var j = numEnemies; j >= 0; --j){  
		      currentEnemy = enemies[j];  
		      gScreen.removeChild(currentEnemy);  
		      enemies.splice(j, 1);  
		  }  
		}  
		
		function gameLoop() { 
		    if(gameOver !== true) {  
		        collide();  
		        spawnEnemy();  
		        checkPlayerBounds();  
		        spawnPlayer();
		    }  
		    updateBullets() ;
		    updateEnemies();
		    updateExplosions(); 
		    updateScore();
		}  
		
		function distance(obj1, obj2) { 
		    if(obj1 !== null && obj2 !== null){ 
		        var difx = obj2.x - obj1.x;  
		        var dify = obj2.y - obj1.y;  
		        return Math.sqrt( (difx*difx) + (dify*dify) ); 
		    } 
		}  
		
		function randRange(min, max) {  
		    return Math.floor(Math.random() * (max - min)) + min;  
		}
	}
	this.frame_39 = function() {
		this.stop();
		this.dispatchEvent('closed');
		this.removeAllChildren();
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(19).call(this.frame_19).wait(20).call(this.frame_39).wait(1));

	// score_txt
	this.gameScore_mc = new lib.gameScore();
	this.gameScore_mc.setTransform(237,-21.1);
	this.gameScore_mc.alpha = 0;
	this.gameScore_mc._off = true;

	this.timeline.addTween(cjs.Tween.get(this.gameScore_mc).wait(14).to({_off:false},0).to({y:28.9,alpha:1},5).wait(1).to({y:18.9},0).to({y:-21.1,alpha:0},5).to({_off:true},1).wait(14));

	// background
	this.instance = new lib.Tween3("synched",0);
	this.instance.setTransform(192,255.5);
	this.instance.alpha = 0;
	this.instance._off = true;

	this.instance_1 = new lib.Tween4("synched",0);
	this.instance_1.setTransform(192,255.5);
	this.instance_1._off = true;

	this.timeline.addTween(cjs.Tween.get(this.instance).wait(1).to({_off:false},0).to({_off:true,alpha:1},13).wait(6).to({_off:false,alpha:0},13).to({_off:true},6).wait(1));
	this.timeline.addTween(cjs.Tween.get(this.instance_1).wait(1).to({_off:false},13).wait(6).to({startPosition:0},0).to({_off:true,alpha:0},13).wait(7));

}).prototype = p = new cjs.MovieClip();
